export default class Channels extends React.Component {

    render() {
        return (
            <div>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ant1</button>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Alpha</button>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Mega</button>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Star</button>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Skai</button>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert1</button>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert2</button>
                <button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert3</button>
            </div>
        )
    }
}
